import React from "react";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import { Link } from "react-router-dom";
import { useAuth } from "../context/auth";

function Navigation(props) {
    const { authTokens } = useAuth();
    const styledNavLink = {
        textDecoration: "none",
        color: "white",
        marginLeft: "10px",
        marginTop: "5px"
    }
    const styledHeader = {
        textDecoration: "none",
        color: "white",
        fontSize: "1.5em"
    }

    return (
        <Navbar bg="primary" variant="dark" expand="md">
            <Link to="/" style={styledHeader}>Barnwood Site</Link>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            {authTokens ? (
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <NavDropdown title="Products" id="basic-nav-dropdown">
                            <NavDropdown.Item to="/products">Admin: Product List</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item to="/products/new">Admin: Create Product</NavDropdown.Item>
                        </NavDropdown>
                        <Link to="/users" style={styledNavLink}>Admin: User List</Link>
                        <Link to="/contact" style={styledNavLink}>Contact Us</Link>
                    </Nav>
                    <Nav>
                        <Link to="/logout" style={styledNavLink}>Log Out</Link>
                    </Nav>
                </Navbar.Collapse>
            ) : (
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Link to="/products" style={styledNavLink}>Admin: Product List</Link>
                        <Link to="/contact" style={styledNavLink}>Contact Us</Link>
                    </Nav>
                    <Nav>
                        <Link to="/register" style={styledNavLink}>Register</Link>
                        <Link to="/login" style={styledNavLink}>Login</Link>
                    </Nav>
                </Navbar.Collapse>
            )}
        </Navbar>
    )
}

export default Navigation;
